/**
 * @param {string} s
 * @return {number}
 */
// https://leetcode.com/problems/longest-substring-without-repeating-characters/
// 29.22%
var lengthOfLongestSubstring = function (s) {
  // 存到以某个位置字符开始的最大长度
  let lenList = []

  // 最大长度
  let longestLen = 0
  let i = 0
  while (i < s.length) {
    // 当前元素开始的长度肯定为 1
    lenList.push(1)

    if (longestLen < 1) {
      longestLen = 1
    }

    // 遍历list，更新最大值
    let j = i - 1

    while (j >= 0) {
      // [j+1,i] 的子串
      const substr = s.substr(j + 1, i - j)

      // 是否包含字符
      if (!substr.includes(s[j])) {
        lenList[j] = lenList[j + 1] + 1

        // 记录最大值
        if (longestLen < lenList[j]) {
          longestLen = lenList[j]
        }
      } else {
        break
      }

      j -= 1
    }

    i += 1
  }

  return longestLen
};

// 滑动窗口，简洁
// 45.06% 
var lengthOfLongestSubstring2 = function (s) {
  // key 为字符，value 为字符的 index + 1，如果有相同的字符，可根据 value 计算出不重复的区间
  let map = new Map()
  let longestLen = 0

  let i = 0
  let j = 0
  while (i < s.length) {
    if (map.has(s[i])) {
      // 取出对应的左边界，取其最大值。因为有可能重复的字符在左边，比如 abba，遍历到最后一个 a，它对应的值是 1，而此时 j = 2， 因此需要取最大值。
      j = Math.max(map.get(s[i]), j)
    }

    const len = i - j + 1
    longestLen = Math.max(len, longestLen)

    // 设置左边界
    map.set(s[i], i + 1)
    i += 1
  }

  return longestLen
}

